function toastSuccess(t){Toastify({text:t,duration:3e3,close:!1,gravity:"top",position:"center",className:"rounded-5"}).showToast()}function toastWarning(t){Toastify({text:t,duration:3e3,close:!1,gravity:"top",position:"center",className:"rounded-5",style:{background:"linear-gradient(to right, rgb(255, 95, 109), rgb(255, 135, 95))"}}).showToast()}